// Dashboard.js

import React from 'react';
import { BrowserRouter as Router, Link, Route, Switch } from 'react-router-dom';
import AddVideo from './AddVideo';
import AddCategory from './AddCategory';
import ShowVideos from './ShowVideos';

const Dashboard = () => {
  return (
    <Router>
      <div>
        <nav>
          <ul>
            <li>
              <Link to="/dashboard/add-video">Add Video</Link>
            </li>
            <li>
              <Link to="/dashboard/add-category">Add Category</Link>
            </li>
            <li>
              <Link to="/dashboard/show-videos">Show Videos</Link>
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/dashboard/add-video">
            <AddVideo />
          </Route>
          <Route path="/dashboard/add-category">
            <AddCategory />
          </Route>
          <Route path="/dashboard/show-videos">
            <ShowVideos />
          </Route>
        </Switch>
      </div>
    </Router>
  );
};

export default Dashboard;
